import { FETCH_DATA, FETCH_DATA_SUCCESS, FETCH_DATA_ERROR } from '../actions/dataActions';

const initialState = {
    data: [],
    isFetching: false
}

export const dataReducer = (state = initialState, action) => {
    switch(action.type){
        case FETCH_DATA:
            return state;
        case FETCH_DATA_SUCCESS:
            return state;
        case FETCH_DATA_ERROR:
            return state;
        default:
            return state;
    }
}
